The mastermind behind the attacks on Nightcrawler&#39;s loved ones is revealed&hellip;
And when Nightcrawler calls upon his friends for backup, the fight comes to the Jean Grey School!
But torn between two worlds&mdash;his family and the X-Men&mdash;who will Nightcrawler stand by?
One thing&#39;s for sure: When the dust settles, one of his worlds will be changed forever&hellip;

